import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  { field: 'userName', headerName: 'Username', width: 130 },
  { field: "teams", headerName: "Teams", width: 50 },
  { field: "totalMileage", headerName: "Total Mileage Logged", width: 80 }
];

const rows = [
  { id: 1, userName: "rMoore", teams: "2"},
  { id: 2, userName: "cMcEachern", teams: "2"},
  { id: 3, userName: "mRoberts", teams: "2"},
  { id: 4, userName: "dConnell", teams: "2"},
  { id: 5, userName: "pHogan", teams: "2"},
  { id: 6, userName: "jPerrin", teams: "2"},
  { id: 7, userName: "nDiMartino", teams: "2"},
  { id: 8, userName: "cLaird", teams: "2"},
  { id: 9, userName: "bBrown", teams: "2"},
  { id: 10, userName: "aWalde", teams: "2", },
];

export default function DataTable() {
  return (
    <div style={{ height: 400, width:"50%", alignContent:"center"}}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  );
}
